import React from 'react';
import '../../App.css';
import './SignUp.css';
import ImageSlider from "./../ImageSlider";
import './../Gallery.css';
import { Link } from 'react-router-dom/cjs/react-router-dom.min';

const SignUp = () => {
  const slides0 = [
    { url: "myImages/sheep.jpg", title: "beach" },
    { url: "myImages/lake.webp", title: "boat" },
    { url: "myImages/rose.webp", title: "forest" },
  ];


  const containerStyles = {
    width: "635px",
    height: "500px",
    margin: "0 auto",
  };


  return (
    <div>
      <div className="my_photo" style={containerStyles}>
        <ImageSlider slides={slides0} />
      </div>
      <div>
        <h1>  </h1>
        <h1>Embracing the Beauty of Tomorrow</h1>
      </div>



      <div className='my_image_texts'>
  <a href='https://www.instagram.com/shiva74o6/' className='my_image_text'> <h2>Shiva <i class="fa-brands fa-instagram"></i></h2> </a>
  </div>




    </div>
  );
}

export default SignUp;
